import React, { useState, useEffect } from "react";
import Modal from "react-modal";

const Resume = () => {
  const [modal, setModal] = useState(false);

  const switchModal = () => {
    setModal(!modal);
  };

  useEffect(() => {
    switchModal();
  }, []);
  return (
    <Modal isOpen={modal}>
      <iframe src="../images/resume.pdf" />
      <button onClick={switchModal}>X</button>
    </Modal>
  );
};

export default Resume;
